import {useSelector} from "react-redux"
import Card from "../Card/Card";


const Favorites = () => {
    const favorites = useSelector(state => state.myFavorites);

    return(
        <div>
            {favorites.map(({ id, name, species, gender, image, status, origin }) => {
                 <Card 
                  key={id}
                  id={id}
                  name={name}
                  image={image}
                  species={species}
                  gender={gender}
                  status={status}
                  origin={origin}
                  />
                })
            }
        </div>
    )
}

export default Favorites;
